const FilterBar = () => {

    
    

    
    return (
            <div className="filter">
                
                    return (
                        <li key={checkbox.id}>
                            <input 
                                type="radio"
                                value={checkbox.label} 
                                id={checkbox.label}
                                
                            />
                            <label htmlFor={checkbox.label}>{checkbox.label}</label>
                        </li>
                    )
                })}
            </div>
    );
};

export default FilterBar;
